import numpy as np
import matplotlib.pyplot as plt
from scipy.stats import mannwhitneyu


def Normalization(Matrix):
    max_len = 0
    for v in Matrix:
        max_len = max(max_len, len(v))
    for v in Matrix:
        while len(v) < max_len:
            value = v[0]
            v.insert(0, value)
    return Matrix


def draw_convergence(x_D, D_obj, x_G, G_obj, x_DG, DG_obj, x_Proposal, Proposal_obj, f, p_value, move):
    plt.rcParams['font.sans-serif'] = ['SimHei']
    plt.rcParams['axes.unicode_minus'] = False

    plt.semilogy(x_D, D_obj, label='DECC-D', linestyle=':', color='plum')
    plt.semilogy(x_G, G_obj, label='DECC-G', linestyle=':', color='aqua')
    plt.semilogy(x_DG, DG_obj, label='DECC-DG', linestyle=':', color='grey')
    plt.semilogy(x_Proposal, Proposal_obj, label='Proposal', color='red')

    # plt.plot(x_D, D_obj, label='DECC-D', linestyle=':', color='plum')
    # plt.plot(x_G, G_obj, label='DECC-G', linestyle=':', color='aqua')
    # plt.plot(x_DG, DG_obj, label='DECC-DG', linestyle=':', color='grey')
    # plt.plot(x_Proposal, Proposal_obj, label='Proposal', color='red')
    font_title = {'size': 18}
    font = {'size': 16}
    plt.title('$f_' + '{' + str(f) + '}$', font_title)
    plt.xlabel('Fitness evaluation times (×${10^6}$)', font)
    plt.ylabel('Fitness', font)
    plt.legend()
    if p_value < 0.05:
        if p_value < 0.01:
            plt.text(3, move, "**", fontdict={'size': 14, 'color': 'red'})
        else:
            plt.text(3, 5 * move, "*", fontdict={'size': 14, 'color': 'red'})
    plt.savefig(
       '/Users/ISDL/PycharmProjects/GALINC-Rmin/Data/pic/' + 'f' + str(f))
    plt.show()


def ave(array):
    result = []
    for i in range(len(array[0])):
        result.append(np.mean(array[:, i]))
    return result


def Holm(D_obj, G_obj, DG_obj, proposal_obj,  test):
    result = {'D_G': test(D_obj, G_obj)[1], 'D_DG': test(D_obj, DG_obj)[1], 'D_P': test(D_obj, proposal_obj)[1],
              'G_DG': test(G_obj, DG_obj)[1], 'G_P': test(G_obj, proposal_obj)[1],  'DG_P': test(DG_obj, proposal_obj)[1]}
    result = dict(sorted(result.items(), key=lambda d: d[1]))
    flag = len(result)
    for (k, v) in result.items():
        result[k] = v * flag
        flag -= 1
    return result


def final(D_obj, G_obj, DG_obj, Proposal_obj):
    D_final = D_obj[:, len(D_obj[0]) - 1]
    G_final = G_obj[:, len(G_obj[0]) - 1]
    DG_final = DG_obj[:, len(DG_obj[0]) - 1]
    Proposal_final = Proposal_obj[:, len(Proposal_obj[0])-1]
    print('D final: ', '%e' % np.mean(D_final), '±', '%e' % np.std(D_final, ddof=1))
    print('G final: ', '%e' % np.mean(G_final), '±', '%e' % np.std(G_final, ddof=1))
    print('DG final: ', '%e' % np.mean(DG_final), '±', '%e' % np.std(DG_final, ddof=1))
    print('Proposal final: ', '%e' % np.mean(Proposal_final), '±', '%e' % np.std(Proposal_final, ddof=1))
    return D_final, G_final, DG_final, Proposal_final


def increase(ave):
    for i in range(len(ave)-1):
        if ave[i+1] > ave[i]:
            ave[i+1] = ave[i]
    return ave


